import React,{useState} from 'react';
import styled from 'styled-components';

import { useNavigate } from 'react-router-dom';
import axios from '../axios';



function Signup() {
    const navigate = useNavigate();
    const[fullName, setFullName]=useState("");
    const[email,setEmail]=useState("");
    const [password,setPassword]=useState("");

    const signup =(e)=>{
        e.preventDefault();
        axios
        .post('/auth/signup',{email,password,fullName})
        .then((res)=>alert(res.data.message))
        .catch((err)=>console.warn(err));
        navigate("/login");
    }

  return (
    <Container>

      
      <Logo onClick={()=>navigate("/")}>
        <img src="logotry1.jpg" alt="" />
    </Logo>
    <FormContainer>
        <h3>Sign-Up</h3>
        <InputContainer>
        <p>Full Name</p>
        <input type="text" placeholder="John Smith"
        onChange={(e) => setFullName(e.target.value)}
        value={fullName}
        />
        </InputContainer>
        <InputContainer>
        <p>Email</p>
        <input type="email" placeholder="example@example.com"
         onChange={(e) => setEmail(e.target.value)}
         value={email}
        />
        </InputContainer>
        <InputContainer>
        <p>Password</p>
        <input type="password" placeholder='*********'
         onChange={(e) => setPassword(e.target.value)}
         value={password}
        />
        </InputContainer>
        <SignUpButton onClick={signup}>
        Create Account in AnnaJones
         </SignUpButton>

         <InfoText>
        We're excited to join you on your
         fashion journey

        </InfoText> 

        
    </FormContainer>
    <LoginButton onClick={()=>navigate("/login")}>Back to Login</LoginButton>
    </Container>
  )
}
const Container=styled.div`
    width:40%;
    min-width:450px;
    height:fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    align-items:center;

`;

const Logo =styled.div`
    width:120px;
    margin-bottom:20px;

    img{
        width:100%;
    }

`;

const FormContainer =styled.form`
    border:1px solid lightgray;
    width:55%;
    height:fit-content;
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    padding:15px;

    h3{
        font-size:28px;
        font-weight:400;
        line-height:0px;
        align-self:flex-start;
    }

`;
const InputContainer =styled.div`
    width:100%;
    padding:10px;
    p{
        font-size:14px;
        font-weight:600;
    }

    input{
        width:95%;
        height:33px;
        padding-left:5px;
        border-radius:5px;
        border:1px solid lightgray;
        margin-top:5px;

        &:hover{
            border:1px solid black;
        }
    }

`;


const LoginButton =styled.button`
    width:55%;
    height:40px;
    background-color:#f3b414;
    border:none;
    outline:none;
    border-radius:10px;
    margin-top:20px;


`;
const InfoText = styled.p`
    font-size:12px;
    width:100%;
    word-wrap:normal;
    word-break:normal;
    margin-top:20px;

`;


const SignUpButton = styled.button`
    width:100%;
    hight:50px;
    font-size:12px;
    margin-top:30px;
    margin-bottom:10px;


    &:hover{
        background-color:#dfdfdf;
        border:1px solid darkgray;
    }
`;



export default Signup
